import React from "react";
import "./App.css"
import { Link } from "react-router-dom";


function Nav(){
    return(
      <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
        <Link>
            <li>Home</li>
            <li>About</li>
            <li>Projects</li>
            <li>Contact Info</li>
        </Link>
            
        </ul>
      </nav>
    )
}



export default Nav;
